    {
        for (unsigned int i = 0; i < (sizeof(namedResourceList) / sizeof(namedResourceList[0])); ++i)
        {
            if (namedResourceList[i] == resourceNameUTF8)
                return originalFilenames[i];
        }

        return nullptr;
    }

